import React, { useState, useEffect } from "react";
import TableList from "./TableList";
import { loadContributors } from "./../logic/contributorsActions";

function Dashboard() {
  const [contributorsList, setContributorsList] = useState([]);

  // console.log("there is the contributors in DASHBOARD", contributorsList);

  return (
    <>
      <h1>Contributors List</h1>
      <input></input>
      <button
        onClick={(event) => {
          event.preventDefault();
          loadContributors().then(setContributorsList);
        }}
      >
        Get users!
      </button>
      <TableList contributorsList={contributorsList} />
    </>
  );
}

export default Dashboard;
